- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    is an all volunteer Committee with no paid staff of any kind. No other entity
    pays compensation for their employees to work for the committee. No payroll expenses
    are incurred. The Committee maintains both Federal and Non Federal accounts, and
    beginning with this report, it has elected to allocate administrative expenses
    between accounts. Starting in June 2008, administrative and overhead expenses
    are apportioned on the 36 percent federal, 64 percent non federal split pursuant
    to regulations and reported here on Schedule H1. Joint operating expenses are
    identified and apportioned in this monthly report on Schedule H4. The transfer
    of accumulated expenses from the Non Federal account to the Federal account will
    occur in August 2008 and be reported in the September2008 monthly report. The
    Committee does not engage in any fundraising on behalf of candidates for Federal
    office, so all of its reported fundraising expenses are party fundraising. This
    amendment addresses an inquiry from the FEC dated January 9, 2009, regarding cumulative,
    itemized and unitemized contributions reported on line 11(a) of our Detailed Summary
    Page. This and future reports will not adjust cumulative totals of itemized and
    unitemized contributions when a given donor's reporting threshold of $200 for
    the calendar year is reached. The FEC letter also inquired whether certain party
    building expenses were more properly classified as FEA. While the classification
    of expenses assosiated with a booth at a community fair could be debated, we have
    chosen to revise our report to classify the questioned expenses as Federal Election
    Activity. Additional expenditures for a similar event, though not questioined
    in the FEC letter, were also reclassified as FEA. In future years when federal
    candidates seek election, we will report community fair expenditures as FEA to
    apply consistency in our classifications. This amendment also aligns the starting
    balance of this report with the corrected ending balance of our amended May 2008
    report.\n"
